Brainiac 5 and Dawnstar challenge the status quo of the archaic planet they have crashed on, causing some people to question their god, Kol. The leader of their society decides to allow Brainiac 5 and Dawnstar to leave. Brainiac 5 meets with members of the United Planets and requests to be part of an expedition that goes back to the planet to research it. Meanwhile, Dev-Em has been sent to the Dark Circle to infiltrate them. Unfortunately, his ruse was discovered and he has been poisoned with kryptonite.

